import React from 'react';
import './custom-button.styles.scss';

const CustomButton = ({children, ...otherProps}) => (
    <button className={`${isGoogleSignIn ? 'google-sign-in' : ''} custom-button`} {...otherProps}>
        {children}
    </button>
)

export default CustomButton;
